class ParsePackets:
    def __init__(this, player, server):
        this.client = player
        this.server = player.server
        this.Cursor = player.Cursor

    def parsePacket(this, C, CC, packet):
        invalid = False
        invalidType = ""

        if C == Identifiers.recv.Old_Protocol.C:
            if CC == Identifiers.recv.Old_Protocol.Old_Protocol:
                # Old Protocol
                p = ByteArray(packet)
                data = p.readUTF()
                this.client.parsePackets.parsePacketUTF(data)
            else:
                invalid = True
                invalidType = "Old Protocol"

        elif C == Identifiers.recv.Login.C:
            if CC == Identifiers.recv.Login.Login:
                # Login
                p = ByteArray(packet)
                playerName, password, url, startRoom, key = this.client.TFMUtils.parsePlayerName(p.readUTF()), p.readUTF(), p.readUTF(), p.readUTF(), p.readInt()

                canLogin = False

                if not re.match("^[ a-zA-Z0-9]*$", playerName):
                    this.client.transport.loseConnection()

                if this.server.checkURL:
                    if url.startswith("app:/TransformiceAIR.swf/") and this.server.allowStandalone:
                        pass
                    else:
                        for urlCheck in this.server.serverURL:
                            if url.startswith(urlCheck):
                                canLogin = True
                                break

                        if not canLogin:
                            this.client.sendPlayerBanLogin(0, "Acesse pelo site: " + this.server.serverURL[0])
                            this.client.transport.loseConnection()
                            return
                this.client.loginPlayer(playerName, password, startRoom)

            elif CC == Identifiers.recv.Login.Create_Account:
                # Create Account
                p = ByteArray(packet)
                playerName, password, captcha, url = this.client.TFMUtils.parsePlayerName(p.readUTF()), p.readUTF(), p.readUTF(), p.readUTF()

